import React, { useState } from 'react';


export const Homepage = () => {
    
    
    const Card = ({ vehicle_id, make, model, year, odometer, onDelete }) => {
        return (
        <div className="card">
            <h2>{make} - {model}</h2>
            <p>Year: {year}</p>
            <p>Odometer: {odometer}</p>
            <button onClick={() => onDelete(vehicle_id)}>Delete</button>
        </div>
        );
    };
      


    const PopUpForm = ({ onSubmit }) => {
        var new_vehicle_id;
        const [make, setMake] = useState('');
        const [model, setModel] = useState('');
        const [year, setYear] = useState('');
        const [odometer, setOdometer] = useState('');

        const handleSubmit = (e) => {
            e.preventDefault();
            
            
            const data = {
                make:make,
                model:model,
                year: year,
                odometer: odometer
            };
            const headers = {
                'Content-Type': 'application/json',
                'Access-Control-Allow-Origin':'*',
                'Access-Control-Allow-Methods':'POST,PATCH,OPTIONS'
            };
            fetch("http://localhost:5000/add_vehicle", {
                method: 'POST',
                headers: headers,
                body: JSON.stringify(data),
            })
            .then((response)=>{
                response.json().then(function(result){
                    console.log("ID",result["vehicle_id"])
                    new_vehicle_id=result["vehicle_id"]
                    // console.log(new_vehicle_id)
                    const vehicle_id = String(new_vehicle_id);
                    // console.log(vehicle_id)
                    onSubmit({ vehicle_id, make, model, year, odometer });
                    setMake('');
                    setModel('');
                    setYear('');
                    setOdometer('');
                })
            })
            .then((data) => {
                console.log('Success:', data);
                
            })
            .catch((error) => {
                console.error('Error:', error);
            });
            
            
        };
      
        return (
          <div className="popup">
            <form onSubmit={handleSubmit}>
              <label htmlFor="make">Make:</label>
              <input
                type="text"
                id="make"
                value={make}
                onChange={(e) => setMake(e.target.value)}
                required
              />
              <label htmlFor="model">Model:</label>
              <input
                type="text"
                id="model"
                value={model}
                onChange={(e) => setModel(e.target.value)}
                required
              />
              <label htmlFor="year">Year:</label>
              <input
                type="number"
                id="year"
                value={year}
                onChange={(e) => setYear(e.target.value)}
                required
              />
              <label htmlFor="odometer">Current Odometer:</label>
              <input
                type="number"
                id="odometer"
                value={odometer}
                onChange={(e) => setOdometer(e.target.value)}
                required
              />
              <button type="submit">Submit</button>
            </form>
          </div>
        );
      };
    

      const [cards, setCards] = useState([]);
      const [showPopUp, setShowPopUp] = useState(false);
    
      const handleAddCard = (newCard) => {
        setCards([...cards, newCard]);
        setShowPopUp(false);
      };
    
      const handleDeleteCard = (vehicle_id) => {
        console.log("ID",vehicle_id)
        const data = {
            vehicle_id: vehicle_id
        };
        const headers = {
            'Content-Type': 'application/json',
            'Access-Control-Allow-Origin':'*',
            'Access-Control-Allow-Methods':'POST,PATCH,OPTIONS'
        };
        fetch("http://localhost:5000/remove_vehicle", {
            method: 'POST',
            headers: headers,
            body: JSON.stringify(data),
        })
        .then((data) => {
            console.log('Success:', data);
        })
        .catch((error) => {
            console.error('Error:', error);
        });
        setCards(cards.filter((card) => card.vehicle_id !== vehicle_id));
      };
    
      return (
        <div className="app">
          <div className="header">
            <button onClick={() => setShowPopUp(true)}>Add Card</button>
          </div>
          <div className="card-grid">
            {cards.map((card, index) => (
              <Card
                key={index}
                vehicle_id={card.vehicle_id}
                make={card.make}
                model={card.model}
                year={card.year}
                odometer={card.odometer}
                onDelete={handleDeleteCard}
              />
            ))}
          </div>
          {showPopUp && <PopUpForm onSubmit={handleAddCard} />}
        </div>
      );
    };
